import React from "react";

import Empty from "../../components/empty/Empty";

function Cart() {
  return (
    <div>
      <Empty
        title="Hech narsa topilmadi"
        desc="Bosh sahifadagi to'plamlardan boshlang yoki kerakli maxsulotni qidiruv orqali toping"
        btnTitle="Bosh sahifa"
        Link="/"
      />
    </div>
  );
}

export default Cart;
